  [],\n\t\"revision_timestamp\": \"2016-07-27T23:05:31.286047\",\n\t\"name\": \"1991-92-report-on-disposal-of-wintering-waterfowl-throughout-the-san-luis-valley\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"To minimize over crowding and cholera in
  wintering waterfowl, Alamosa/Monte Vista National Wildlife Refuges initiated an
  experimental effort in November 1990 to disperse waterfowl throughout the San Luis
  Valley. Wintering areas on private land were provided under the Alamosa/ Monte Vista
  NWR's Wildlife Extension Program, in addition to traditional wintering areas. The
  goal of the dispersal effort was to maintain heal thy wintering waterfowl populations
  in the San Luis Valley. This report summarizes results from the second year of the
  experimental program, covering the period October 1991 - March 1992.\",\n\t\"license_title\":
